    //кеширование на 1 минуту
    require_once 'getFloorsInfo.php';
    try {
        $client = getClient();
        $service = new Google_Service_Sheets($client);
        $spreadsheetId = '1kvqBPBPTD_noQpLDhzwvHqdVWbNlnRkyE_v0RycTAQI';
        function getTitles($range, $service, $spreadSheet)
        {
            $response = $service->spreadsheets_values->get($spreadSheet, $range, ['valueRenderOption' => 'FORMATTED_VALUE']);
            $values = $response->getValues();
            $titles = [];
            foreach ($values as $key => $data) {
                if ($key == 0) {
                    foreach ($data as $title) {
                        $titles[] = $title;
                    }
                }
            }

            return $titles;
        }

        function getFloor($range, $service, $spreadSheet)
        {
            $response = $service->spreadsheets_values->get($spreadSheet, $range, ['valueRenderOption' => 'FORMATTED_VALUE']);
            $values = $response->getValues();

            $floor = [];
            $i = 0;
            foreach ($values as $key => $data) {
                if ($data[0] != '') {
                    $floor[$i] = $data;
                    $i++;
                }
            }

            return $floor;
        }

        function getAllInfo($range, $service, $spreadSheet){
            $response = $service->spreadsheets_values->get($spreadSheet, $range, ['valueRenderOption' => 'FORMATTED_VALUE']);
            $values = $response->getValues();

            return $values;
        }

        $titles = getTitles("B2:L2", $service, $spreadsheetId);
        $floor2 = getFloor("B3:L25", $service, $spreadsheetId);
        $floor3 = getFloor("B28:L50", $service, $spreadsheetId);
        $floor4 = getFloor("B53:L75", $service, $spreadsheetId);
        $floor5 = getFloor("B78:L97", $service, $spreadsheetId);

        $business_titles = getTitles("'Лист2'!A2:K2", $service, $spreadsheetId);
        $cokol = getFloor("'Лист2'!A5:K9", $service, $spreadsheetId);
        $floor1 = getFloor("'Лист2'!A14:K24", $service, $spreadsheetId);

        $parking_spreadsheetId = '1BySrUbHl8dL-OexWOYPiasg6hg--SwYh4qkjkfkXO1M';
        $parking = getFloor("'Лист2'!B3:B26", $service, $parking_spreadsheetId);

        $json_cache = [];
        $json_cache['time'] = time();
        $json_cache['titles'] = $titles;
        $json_cache['floor2'] = $floor2;
        $json_cache['floor3'] = $floor3;
        $json_cache['floor4'] = $floor4;
